VALUES ('20594459', 'Pâte Feuilletée Garnie de Saumon', 'Pâte feuilletée garnie de saumon et d\'une préparation à base d\'épinards. Ingrédients Pâte feuilletée (50%) : farines (farine de blé, farine de fèves, farine de blé malté, antioxydant : acide ascorbique), beurre (lait) (beurre (lait), colorant : caroténoïdes), eau, sel, dorure à l\'Œuf. Garniture (50%) : 28,6% saumon cuit (poisson),12,1% épinards, crème fraîche (lait, vin blanc, beurre (lait), ail, farine de blé, échalotes, fond de poisson (fumet de poisson (cabillaud (poisson), extrait de saumon (poisson), eau, sel), maltodextrine de blé, extrait de moule, sel, fond de poulet (os, viandes et graisses de poulet, eau, sel), échalotes, dextrose, légumes en poudre, vin blanc réduit, vinaigre dialcool réduit, arômes, concentrés de légumes (contient céleri), extraits de levure, sirop de glucose, lactose, protéines de lait), sel, poivre. Pourcentages exprimés sur le total de la recette. Traces éventuelles de crustacés, de moutarde, de soja et de fruits à coque. À conserver entre OOC et +40C. Non ouvert, à consommer jusqu\'au : voir face avant. Après ouverture, à consommer sous 24 heures. Conditionné sous atmosphère protectrice. Conseils de préparation Au four traditionnel : préchauffer votg four 10 minutes à 21 OOC (thermostat 7). Enlever le feuilleté de l\'emballage plastique. Laisser réchauffer sur grille à mi-hauteur 20 minutes environ à 1800C (thermostat 6). Nous vous déconseillons l\'usage du four à micro-ondes. DECLARATION NUTRITIONNELLE', '', '12.2', '8.3', '23.6', '2.3', '', '8.9', '0.76', '0.299212598425197', '', '1');

